import React, { useEffect, useState } from "react";
import axiosInstance from "../../baseurl";
import { useNavigate } from "react-router-dom";

function ViewCustomer() {
  const [cusdata, setcdata] = useState([
    { name: "cus1", email: "testmail1", empid: 1, gender: "male" },
    { name: "cus2", email: "testmail2", empid: 2, gender: "female" },
  ]);

  const navigate = useNavigate();
  if (localStorage.getItem("adminlog") == null) {
    navigate("/Admin/Adminpage");
  }
  useEffect(() => {
    axiosInstance
      .post(`/viewCustomers`)
      .then((res) => {
        console.log(res, "cus");
        if (res.data.msg == "No Data obtained ") {
          setcdata([]);
        } else {
          setcdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div class="container-top">
      <div class="accordion" id="accordionExample">
        <div class="accordion-item">
          <h2 class="accordion-header">
            <button
              class="accordion-button"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#collapseOne"
              aria-expanded="false"
              aria-controls="collapseOne"
            >
              View all Customer
            </button>
          </h2>
          <div
            id="collapseOne"
            class="accordion-collapse collapse"
            data-bs-parent="#accordionExample"
          >
            <div class="accordion-body">
              <div class="container text-center">
                <div class="row">
                  {/* cusdata details mapped */}
                  {cusdata.length ? (
                    cusdata.map((a) => {
                      return (
                        <div className="col-4">
                          <div class="card" >
                                <div class="card-body">
                                  <h5 class="card-title">Name : {a.name}</h5>
                                  <p class="card-text">Email : {a.email}</p>
                                  <p class="card-text">Contact : {a.contact}</p>

                                  <p class="card-text">Gender : {a.gender}</p>
                                </div>
                              </div>
                        </div>
                      );
                    })
                  ) : (
                    <div class="card card-body">
                      <div className="main">
                        <div class="card" style={{ width: "18rem;" }}>
                          <div class="card-body">
                            <h5 class="card-title">No data</h5>
                          </div>
                        </div>
                      </div>
                    </div>
                  )}
                </div>
              </div>
              {/* cusdata details mapped */}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ViewCustomer;
